apiVersion: argoproj.io/v1alpha1
kind: Application
metadata:
  name: apps-cluster-aws-cluster-3
  annotations:
    argocd.argoproj.io/sync-wave: "350"
  labels:
    gitops.tier.layer: applications
  finalizers:
    - resources-finalizer.argocd.argoproj.io
spec:
  syncPolicy:
    automated:
      prune: true
      selfHeal: true
  destination:
    namespace: openshift-gitops
    server: https://kubernetes.default.svc
  project: applications
  source:
    path: clusters/cluster-build/aws/
    helm:
      values: |
        cluster: aws-cluster-3
        type: aws
        imageName: img4.8.24-x86-64-appsub

        provider:
            region: eu-central-1
            baseDomain: ibmsbaasonaws.com
            aws_access_key_id: 
            aws_secret_access_key: 
            pullSecret: 
            sshPrivatekey: 
            installConfig: 

        ${GIT_GITOPS_BRANCH}s:
            count: 3
            diskIops: 4000
            diskSize: 100
            diskType: io1
            machineType: m5.xlarge

        workers:
            count: 3
            diskIops: 4000
            diskSize: 100
            diskType: io1
            machineType: m5.xlarge

        powerState: Running

        networking:
          clusterNetwork:
            - cidr: 10.255.0.0/14 # aws cluster 2 has 10.128.0.0/14
              hostPrefix: 23
          machineNetwork:
          - cidr: 10.0.0.0/16
          networkType: OpenShiftSDN
          serviceNetwork:
          - 172.40.0.0/16  # aws cluster 2 has 172.30.0.0/16

